import React from "react";
import Banner from "../components/Banner";
import Heading from "../components/Heading";
import CategoryCard from "../components/CategoryCard";
import { acc1, acc2, acc3, acc4, featured1 } from "../assets/images/products";
import FeaturedCard from "../components/FeaturedCard";
import { Link } from "react-router-dom";

const Homepage = () => {
  return (
    <section className="max-container px-5">
      <Banner />
      <div className="py-10 flex flex-col gap-10">
        <div className="product-catalog">
          <Heading title={"Categories"} heading={"Browse By Category"} />
          <div className="flex justify-between">
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
            <CategoryCard title={"Title"} />
          </div>
        </div>
        <div className="product-catalog">
          <Heading
            title={"Featured Products"}
            heading={"Our Featured Products"}
          />
          <div className="grid grid-cols-5 gap-4">
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
