              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Accessories"} heading={"Electronics Accessories"} />
          <div className="gap-4 border-2 p-4 border-orange-100">
            <div className="grid grid-cols-2">
              <div className="w-40">
                  <img src={acc1} alt="" className="object-cover" />
                  <h1 className="font-medium">Headphones</h1>
              </div>
              <div className="w-40">
                  <img src={acc2} alt="" className="object-cover" />
                  <h1 className="font-medium">Headphones</h1>
              </div>
              <div className="w-40 flex flex-col items-center">
                  <img src={acc3} alt="" className="object-cover" />
                  <h1 className="font-medium">Headphones</h1>
              </div>
              <div className="w-40 flex flex-col items-center justify-end">
                  <img src={acc4} alt="" className="object-cover" />
                  <h1 className="font-medium">Headphones</h1>
              </div>
            </div>
            <Link to={'/'} className="hover:text-orange-500">See all</Link>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
